        <img
        src='https://m.media-amazon.com/images/I/61N83xtyr6L._SX3000_.jpg'
        alt='Home page'
        className='home_image'
        />

        <div className='home_row'>
          <Product 
          id={1}
          title="the best selling healthy product chain"
           price={29.99}
