          rating={4}
          />
        </div>

        <div className='home_row'>
           <Product
          id={3}
           title="the best selling healthy product chain"
           price={30.99}
          image="https://images-na.ssl-images-amazon.com/images/I/811aUa8DcxL.__AC_SX300_SY300_QL70_FMwebp_.jpg"
          rating={3}
           />
           <Product
            id={4}
           title="the best selling healthy product chain"
           price={14.99}
           image="https://images-na.ssl-images-amazon.com/images/I/811aUa8DcxL.__AC_SX300_SY300_QL70_FMwebp_.jpg"
          rating={5}
           />
           <Product/>
